import React from "react";

const PrevReport = ({ item }) => {
  return (
    <div className="card">
      <p>IR - {item.id}  
        _____Name - {item.title} 
        ____Location - <img src = {item.thumbnailUrl}/></p>
    </div>
  );
};

export default PrevReport;
